import React from 'react'
import NSMultiSelect from '../components/NSMultiSelect/index'
import { action } from '@storybook/addon-actions';
import { required } from '../utils/validations';

export default {
  title: 'New Story Multi-Select',
  component: NSMultiSelect
}

export function NSMultiSelectContainer({
  label
}) {

// const values = ['red', 'green', 'blue'];
const items = [{ value: 'Home' }, { value: 'Donation' }, { value: 'Family' }];

  return (
    <div>
      <h3>New Story Multi-Select</h3>
        <NSMultiSelect         
        field="test-validation"
        type="select"
        label="Example Selector"
        values={[]}
        items={items}
        onChange={action('Selected')}
        initialValue={[]}
        padding="25px 18px 10px 13px"
        validate={required}
        validateOnChange
        validateOnBlur/>
    </div>
  )
}
